.navigation {
  width: 100%;
  display: flex;
  justify-content: center;
  height: 9rem;
  padding: 0 2.3vw;
  z-index: 99;
  position: fixed;
  top: 0;
  transition: 0.2s all ease-in;
}
.navigation__wrapper {
  width: 100%;
  display: flex;
  justify-content: space-between;
  align-items: center;
}
.navigation__logo {
  display: inline-block;
}
.navigation__logo__property {
  width: 90%;
  height: 100%;
}
.navigation .logo_small {
  display: none;
}
.navigation__menu {
  width: 50%;
  height: auto;
  display: flex;
  flex-wrap: nowrap;
  justify-content: space-evenly;
  align-content: center;
}
.navigation__menu__list {
  width: 100%;
  list-style: none;
  display: flex;
  justify-content: space-evenly;
  align-items: center;
}
.navigation__menu__list__items {
  cursor: pointer;
}
.navigation__menu__list__items a {
  display: inline-block;
  text-decoration: none;
  font-size: 1.6rem;
  color: #ffff;
  font-weight: 600;
  transition: all 0.2s;
}
.navigation__menu__list__items a:hover {
  color: #151f28bd;
  transform: translateY(-5px);
}
.navigation .mobile_nav {
  display: none;
}
.navigation .new-opacity {
  display: none;
}
.navigation .hamburger {
  display: none;
}

.nav-scrolled {
  background-color: white;
  transition: 0.2s all ease-in;
  box-shadow: 0px 20px 60px -24px rgba(0, 0, 0, 0.3);
}
.nav-scrolled a {
  color: black;
}

@media only screen and (max-width: 750px) {
  .navigation__menu {
    display: none;
  }

  .hamburger {
    display: block !important;
    width: 4rem;
    height: 100%;
  }
  .hamburger svg {
    width: 100%;
    height: 100%;
    cursor: pointer;
  }

  .active-burger svg path {
    stroke: #fdaf19;
    filter: drop-shadow(0px 0px 7px rgba(255, 0, 0, 0.8));
  }

  .new-nav {
    background-color: white;
    transition: 0.5s all ease;
  }

  .new-opacity {
    clip-path: polygon(0% 0%, 100% 0%, 100% 0%, 0% 0%);
    transition: all 0.5s ease;
    width: 100%;
    display: block;
    position: absolute;
    top: 100%;
    left: 0%;
  }

  .mobile_nav {
    box-shadow: 0px 100px 60px -24px rgba(0, 0, 0, 0.3);
    clip-path: polygon(0% 0%, 100% 0%, 100% 100%, 0% 100%) !important;
    display: block;
    transition: all 0.5s ease;
    width: 100%;
    position: absolute;
    top: 100%;
    right: 0%;
    z-index: 99;
    background-color: white;
    display: block !important;
  }
  .mobile_nav__container {
    width: 100%;
    background-color: white;
    display: flex;
    align-items: center;
    flex-direction: column;
  }
  .mobile_nav__container .mobile__menu {
    width: 100%;
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
  }
  .mobile_nav__container .mobile__menu__list {
    flex-direction: column;
    box-shadow: 0px 20px 60px -24px rgba(0, 0, 0, 0.3);
    width: 100%;
    list-style: none;
    display: flex;
    justify-content: space-evenly;
    align-items: center;
  }
  .mobile_nav__container .mobile__menu__list__items {
    padding: 6vw 0vw;
  }
  .mobile_nav__container .mobile__menu__list__items a {
    text-decoration: none;
    color: black;
    font-weight: 600;
    font-size: 1.8rem;
  }
  .mobile_nav__container .mobile__menu__list__items a:hover {
    color: gray;
  }
}

