      cursor: pointer;
    }
  }
  .work_section {
    display: grid;
    grid-template-rows: 2fr 1fr;

    .introduction {
      display: flex;
      align-items: center;
      justify-content: center;
      position: relative;

      &:after {
        content: "";
        transform: translate(-50%, -50%);
        position: absolute;
        width: 100%;
        height: 100%;
        background: no-repeat url("../pictures/circle.png");
        @include backgroundProperty;
        top: 39%;
        left: 50%;
        z-index: -1;
      }
    }

    &__container {
      width: 70%;

      .paragraph {
        margin-top: 2vw;
        opacity: 60%;
      }
    }

    &__gif {
      background-color: #ffa800;
      width: 100%;
      height: 100%;
      display: flex;
      align-items: center;
      justify-content: center;
      position: relative;
      .yellow {
        width: 100%;
        height: 100%;
        background-color: #ffa800;
        transform: translateY(-3%);
        filter: blur(20px);
        filter: contrast(50px);
        opacity: 0.5;
        position: absolute;
        transform: translate(-50%, -50%);
        top: 46%;
        left: 50%;
        z-index: -1;
      }

      .video {
        background: url("../pictures/comp-1.gif");
        @include backgroundProperty;
        width: 50%;
        height: 80%;
      }
    }
  }
}

